    const [isOpen, setIsOpen] = useState(false)

    const handleCloseDialog = () =>{
        setIsOpen(false)
    }
    const handleButtonClick = () =>{
        setIsOpen(true)
    }
    console.log(isOpen)
    return <>
        <div>
        <CUButton onClick={handleButtonClick}></CUButton>
    |   </div>
        <div>
        <Dialog open={isOpen} title="HOLA" onClose={handleCloseDialog}></Dialog>
        </div>
        </>
}



export default Home
